import React from 'react';
import {BrowserRouter as Router} from 'react-router-dom'
import Banner from './components/banner/Banner';
import Body from './components/body/Body'
import Header from './components/header/Header';

function App() {
  return (
    <Router>
      <div className='App'>
        <Banner/>
        <Header/>
        <Body/>
      </div>
    </Router>
  );
}

export default App;
